import React from 'react'
import SearchResult from './SearchResult'

const SearchResults = ({match, addSong, songs, searchResults, searchMessage, deleteSearchResults}) => {
    const renderList = () => (
        <div>
            {searchResults.map(searchResult => <SearchResult match={match} addSong={addSong} songs={songs} searchResult={searchResult} searchResults={searchResults} deleteSearchResults={deleteSearchResults} />)}
        </div>
    )
    return <div> {!searchMessage ? renderList() : <div>{searchMessage}</div>} </div>
}

export default SearchResults
